KEBIASAAN MINUM KOPI HITAM DENGAN KOLESTEROL DARAH DAN TEKANAN DARAH LELAKI DEWASA

<jats:p>The proliferation of cafes that sell drinks and coffee packaging can increase consumption of processed national coffee beans. In addition to increasing the sale value, the emergence of these shops will also encourage the growth of the creative economy of the coffee commodity, both for the domestic and export markets. This study aims to determine the relationship of black coffee drinking habits with blood pressure and cholesterol levels. This research method uses analytic survey with cross sectional research design. The population in this study were adult men who had the habit of drinking black coffee with a sample size of 84 people, obtained by purposive sampling. Spearman Rank correlation test results show age variables (p = 0,000), education (p = 0.005), genetic history (p = 0,000), frequency of drinking coffee (p = 0,000), smoking activity (p = 0.019), have something to do with pressure blood. It is known that the age variable (p = 0,000), the frequency of drinking coffee (p = 0,000), smoking activity (p = 0.019), have something to do with cholesterol levels. The results of this study differ from many other studies which state there is no relationship between coffee drinking habits with high blood pressure or cholesterol. But, other factors that may have an influence on high blood pressure and cholesterol. The caffeine in coffee is in the form of potassium chlorogenate bonds that can reduce blood pressure. This bond will be released if the coffee is watered with hot water. The content of terpenes in coffee can trigger increased cholesterol levels in the body. The content of the terpenes can actually be removed by filtering the coffee before serving.&#x0D;
Menjamurnya kafe-kafe yang menjajakan minuman maupun kemasan kopi dapat meningkatkan konsumsi minuman hasil olahan biji kopi nasional. Selain menaikkan nilai jual, munculnya kedai-kedai tersebut juga bakal mendorong tumbuhnya ekonomi kreatif dari komoditas kopi, baik untuk pasar domestik maupun ekspor. Penelitian ini bertujuan untuk mengetahui hubungan kebiasaan minum kopi hitam dengan tekanan darah dan kadar kolesterol. Metode penelitian ini menggunakan survei analitik dengan rancangan penelitian cross sectional. Populasi dalam penelitian ini adalah lelaki dewasa  yang memiliki kebiasaan meminum kopi hitam dengan jumlah sampel sebanyak 84 orang, yang didapat dengan cara purposive sampling. Hasil uji korelasi Spearman Rank menunjukkan variabel umur (p = 0,000), pendidikan (p = 0,005), riwayat genetik (p = 0,000), frekwensi minum kopi (p = 0,000), aktifitas merokok (p = 0,019), dengan demikian semua variabel ada hubungannya dengan tekanan darah. Diketahui pula bahwa variabel  umur (p = 0,000), frekwensi minum kopi (p = 0,000), aktifitas merokok (p = 0,019), ada hubungannya dengan kadar kolesterol, ketiga variabel tesebut ada hubungannya dengan kadar kolesterol. Hasil penelitian ini berbeda dengan banyak penelitian lain yang menyatakan tidak ada hubungan kebiasaan minum kopi dengan tekanan darah tinggi maupun kolesterol. Tapi, faktor lain yang kemungkinan memiliki pengaruh terhadap tingginya tekanan darah dan kolesterol. Kafein dalam kopi terdapat dalam bentuk ikatan kalium kafein klorogenat yang dapat mengurangi tekanan darah. Ikatan ini akan terlepas jika kopi disiram dengan air panas. Kandungan terpen dalam kopi dapat memicu meningkatnya kadar kolesterol dalam tubuh. Kandungan terpen tersebut sebenarnya bisa dihilangkan dengan cara melakukan penyaringan kopi sebelum disajikan.</jats:p>

HUBUNGAN MINUM KOPI SECARA RUTIN DALAM JANGKA WAKTU LIMA TAHUN ATAU LEBIH TERHADAP TEKANAN DARAH PENDUDUK DI KOTA DENPASAR

<jats:p>ABSTRAK&#x0D;
Kopi ialah salah satu minuman non-alkoholik yang dikonsumsi secara luas di masyarakat. Peningkatan tekanan darah karena mengonsumsi kopi disebabkan oleh kafein dengan mengikat reseptor adenosin, mengaktivasi sistem saraf simpatik, dan meningkatkan produksi hormon kortisol. Penelitian berikut ini memiliki tujuan untuk mengetahui hubungan antara durasi minum kopi serta frekuensi minum kopi terhadap tekanan darah sistolik dan diastolik penduduk di Denpasar. Penelitian berikut dikategorikan sebagai analitik observasional dengan menggunakan metode potong lintang yang menggunakan 100 sampel. Berdasarkan hasil penelitian, ditemukan hubungan lemah antara durasi minum kopi dan frekuensi minum kopi terhadap tekanan darah sistolik dengan nilai signifikansi yaitu 0,007 dan 0,044 serta koefisien korelasi R berturut-turut menunjukan nilai 0,266 dan 0,201. Namun, tidak ditemukannya hubungan bermakna terhadap tekanan darah diastolik dengan nilai signifikansi sebesar 0,652 dan 0,082 serta koefisien korelasi R berturut-turut menunjukan nilai 0,045 dan 0,174. Kesimpulan dari penelitian ini adalah terdapat hubungan minum kopi secara rutin dalam jangka waktu lima tahun atau lebih terhadap tekanan darah penduduk di Kota Denpasar.&#x0D;
Kata kunci: kopi, sistolik, diastolik</jats:p>
